import React from "react";

import "./ProjectBtn.css";

const ProjectBtn = ({ project, setProject, curProject }) => {
  const handleProject = (e) => {
    e.preventDefault();
    setProject(project);
  };

  return (
    <div>
      <button className="project-btn" type="button" onClick={handleProject}>
        {project.name}
      </button>
    </div>
  );
};

export default ProjectBtn;
